create table Countries
(
    id         int auto_increment
        primary key,
    country_en varchar(100) not null,
    country_ru varchar(100) null,
    latitude   float        not null,
    longitude  float        not null
);


create table InfectedByCountry
(
    id              int auto_increment
        primary key,
    country         varchar(100) not null,
    new_confirmed   int          not null,
    total_confirmed int          not null,
    new_death       int          not null,
    total_death     int          not null,
    new_recovered   int          not null,
    total_recovered int          not null,
    date            datetime     not null
);


create table TotalInfected
(
    id              int auto_increment
        primary key,
    new_confirmed   int      not null,
    total_confirmed int      not null,
    new_death       int      not null,
    total_death     int      not null,
    new_recovered   int      not null,
    total_recovered int      not null,
    date            datetime not null
);

